import { useSelector } from 'react-redux';


function loadAllUsers() {
    
    const teacherList = useSelector(state => state.teacherReducer);
    const studentList = useSelector(state => state.studentReducer);
    const adminList = useSelector(state => state.adminReducer);
    const parentList = useSelector(state => state.parentReducer);
    const userList = teacherList.concat(studentList, adminList, parentList);
    return userList;
}
